r.\\n\\nAmie brugte et år efterfølgende på at være spion og var dygtig til det.\\nDer var ikke nogen som endnu har opdaget eller fundet ud af at Amie er spion.\\nOliver bringer ordre tilbage til Amie og svaret bliver returneret via Oliver. Underligt nok kom Oliver altid tilbage med en eller anden form for mad/snack\\nDe er det perfekte makkerpar.\\n\\nEn dag beslutter hun sig for at blive en del af det brændende svær i håb om at finde ud af hvorfor [[Osty]] forsvandt - ingen ved hvordan dette kommer til at ende.logseq____&quot;,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Flogseq____&quot;,940,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Xlogseq____&quot;,255,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Vlogseq____&quot;,255,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Ulogseq____&quot;,255,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Ulogseq____&quot;,256,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Ulogseq____&quot;,397,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;~:headinglogseq____&quot;,3],536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Jlogseq____&quot;,[],536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Hlogseq____&quot;,256,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^Hlogseq____&quot;,397,536870969]],[logseq____&quot;^15logseq____&quot;,[941,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u662b6f01-2346-42ca-8d85-e1bd81c1aed9logseq____&quot;,536870969]],[logseq____&quot;^15logseq____&quot;,[942,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;logseq____&quot;,536870969]],[logseq____&quot;^15logseq____&quot;,[942 r til at bevæge sig stille og uset alle steder, men specielt i skoven.\\n\\nEfterhånden som han blev ældre fandt han ud af at han kunne tjene penge ved at holde øje med mennesker og hvad de lavede og hvis de havde hemmelige møder i skoven.\\nPengene tjente han ved at få opgaver om at skaffe information af en fra det lokale marked.\\nEfter at have overvåget en del karavaner og set vagter beskytte dem besluttede han at han også kunne klare det job, og at det ville give ham en chance for at komme ud i verdenen.\\nSom lejesvend/vagt lærte han våbenkunst og klarede sig godt ved at vide hvordan man undgår at blive overvåget og forfulgt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1248,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1?logseq____&quot;,536871027]],[logseq____&quot;^15logseq____&quot;,[1248,logseq____&quot;^Flogseq____&quot;,1244,536871027]],[logseq____&quot;^15logseq____&quot;,[1248,logseq____&quot;^Xlogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1248,logseq____&quot;^Vlogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1248,logseq____&quot;^Ulogseq____&quot;,20,536871027]],[logseq____&quot;^15logseq____&quot;,[1248,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,l
